execution.script:
podTemplate(cloud: 'kubernetes-Cluster1', label: 'general-pod-label-cluster1', name: 'general-pod-label-cluster1',
			containers: [
			containerTemplate(args: 'cat', command: '/bin/sh -c', image: 'ubuntu:bionic', name: 'ubuntu-image', ttyEnabled: true),
		    containerTemplate(args: 'cat', command: '/bin/sh -c', image: 'centos:centos7', name: 'centos-image', ttyEnabled: true)
			])
	{
	    stages {
	        stage('Run OS') {
        		parallel {
        		    stage('Build Ubuntu') {
        		        parallel {
        		            stage('check release')
        		        }
        		            }
        			node('general-pod-label-cluster1') {
        				stage ('Build ubuntu') {
        					container ('ubuntu-image') {
        						sh "cat /etc/*-release"
        					}
        				}
        			}
        			node('general-pod-label-cluster1') {
        				stage ('Build centos') {
        					container ('centos:centos7') {
        						sh "cat /etc/*-release"
        					}
        				}
        			}
        		}
        	}
	    }
	}
